import React from 'react'
//import './jobsSelection'

function Jobs() {
    
    const addItem = ()=>{
        return ('select').append( '<option>' + ('#text-to-add').val() + '</option>' );
    }
    return (
        <div>
            <input id="text-to-add" type="text" value="Machine 3"/>
            <button id="new-item" onClick ={addItem}>Add to dropdown</button>
            <form>
                <select name="dropdown">
                    <option>Select...</option>
                    <option>Machine 1</option>
                    <option>Machine 2</option>
                </select>
            </form>
        </div>
    )
}

export default Jobs
